import React, {Component} from 'react';
import {TopHeader} from '../shared/top-header.component';

export class Recommendations extends Component {

    render() {

        const meals = [

            {meal: ' ', kcal: ' ',},
            {meal: 'Breacfast', kcal: '203 - 310',},
            {meal: 'Snack', kcal: '0 - 270'},
            {meal: 'Lunch', kcal: '303 - 440'},
            {meal: 'Snack', kcal: '0 - 270'},
            {meal: 'Dinner', kcal: '423 - 570'}

        ];
        const weekDay =[
            " ",  "Monday", "Tuesday", " Wednesday ", "Thursday", "Friday", "Saturday","Sunday"
        ] ;

        const days = weekDay.map((day, index) => (

            <th className="days" >
                <h5> {day}</h5>
            </th>

    ));


        const food =[
          "Monday", "Tuesday", " Wednesday ", "Thursday", "Friday", "Saturday","Sunday"
        ] ;

        const foodd = food.map((food, index) => (

            <td >
                <h5> {food}</h5>
            </td>

        ));
        const arrMeals = meals.map((meal, index) => (

                    <tr className="reacommended">
                        <h1>{meal.meal}</h1>
                        <p> {meal.kcal} </p>
                    </tr>



        ));


        return (

            <div>
                <TopHeader/>
                <br/>

                <div className="grayBack">
                    <h3> Weekly Diet </h3>
                    <br/>

                    <table className="all">
                        {days}
                        {arrMeals,{foodd}}

                    </table>

                </div>

            </div>

        );
    }
}
